Basic.html.body:
Basic usagereact-day-picker is designed to cover the most common needs for a date picker in a web application. This chapter illustrates the component's basic concepts by implementing a date picker to select, clear and disable days from the calendar.Selecting a dayreact-day-picker doesn't hold the selected day in its state. Instead, you have to save it in your component as the user interacts with the calendar.The following component uses the onDayClick prop to save the clicked day in its own state:import React from 'react';
import DayPicker from 'react-day-picker';

class SelectDay extends React.Component {
  constructor(props) {
    super(props);
    this.handleDayClick = this.handleDayClick.bind(this);
  }
  state = {
    selectedDay: new Date(), // We set the selected default as today
  };
  handleDayClick(day) {
    this.setState({ selectedDay: day });
  }
  render() {
    return (



          The selected day is { this.state.selectedDay.toLocaleDateString() }


    )
  }
}
Somewhere your CSS must style the appearance for the selected day cell, but first you need to tell the Day Picker which days have been selected.We pass then the selected day (saved in the component’s state) to the selectedDays prop. That day cell will get the --selected CSS modifier:import React from 'react';
import DayPicker, { DateUtils } from 'react-day-picker';

class SelectDay extends React.Component {
  constructor(props) {
    super(props);
    this.handleDayClick = this.handleDayClick.bind(this);
  }
  state = {
    selectedDay: new Date(),
  };
  // Check if the day in state is selected 
  isDaySelected(day) {
    return DateUtils.isSameDay(day, this.state.selectedDay);
  }
  handleDayClick(day) {
    this.setState({ selectedDay: day });
  }
  render() {
    return (



          The selected day is { this.state.selectedDay.toLocaleDateString() }


    )
  }
}
Then, in your CSS, add a .DayPicker-Day--selected selector to highlight the cell corresponding to the selected day. For example:.DayPicker-Day--selected {
  background-color: red;
  color: white;
}
Note You can use the CSS contained in react-day-picker/lib/style.css, which contains a basic stylesheet. Read Styling to know how to properly style the component.Clearing the selected dayWhen a selected day is clicked again, we want to clear it. This can be made setting the component's selectedDay to undefined (or null).The onDayClick handler receives as third argument an object that can be inspected to check if the clicked day has been selected or not:// snip
handleDayClick(day, { selected }) {
  if (selected) {
    // Unselect the day if already selected
    this.state({ selectedDay: undefined });
    return;
  }
  this.setState({ selectedDay: day });
}
