    return (

    )
  }
}
Then, style the day to appear as disabled in your CSS using the .DayPicker-Day--disabled selector:.DayPicker-Day--disabled {
  background-color: grey;
  color: white;
  cursor: pointer;
}
Preventing the user to select a disabled dayIn the previous example nothing happens when the user clicks on a day, since the onDayClick prop is missing. As before, we need to save the value of the selected day in our component's state:import DayPicker from 'react-day-picker';

const sundays = day => day.getDay() === 0;

class SelectDay extends React.Component {
  constructor(props) {
    super(props);
    this.handleDayClick = this.handleDayClick.bind(this);
  }
  state = {
    selectedDay: new Date(),
  };
  handleDayClick(day) {
    this.setState({ selectedDay: day });
  }
  render() {
    return (



          The selected day is { this.state.selectedDay.toLocaleDateString() }


    )
  }
}
This, however, will make selectable the disabled days too. We need instead our component to not update its state if the clicked day is disabled.In the click handler we can use the day's modifiers to check if the day was disabled, and prevent its selection:handleDayClick(day, { disabled }) {
  if (disabled) {
    // Do not update the state if the day is disabled
    return;
  }
  this.setState({ selectedDay: day });
}
Check out this example shows a similar implementation.Next stepsThe selectedDays prop and the onDayClick event handler can implement a more complex logic to make the date picker more powerful. For example, you can make the date picker to select a range of days.You can go deeper with the customization using day modifiers. Read more about them in the next chapter.

Modifiers.html.body:
Use of Day ModifiersDay modifiers change the aspect of the day cells and/or customize the interaction with of the calendar.Type of modifier valuesThe value of a modifier can be either:a Date object, to match a specific day

a range object with from and to keys, to match a range of days:const range = { 
  from: new Date(2015, 0, 12), 
  to: new Date(2015, 0, 16) 
}
will match the days between the 12th and the 16th of January.
an object with a before key, to match the days before the given date:const range = { 
  before: new Date(), 
}
will match all the past the days (i.e. the days before today).
an object with a after key, to match the days after the given date:const range = { 
  after: new Date(2018, 0, 1), 
}
will match all the days after the January, 1st 2018.
a function that take the day as first argument and return a boolean value. For example:function sundays(day) {
  return day.getDay() === 0;
}
function isFirstOfMonth(day) {
  return day.getDate() === 1;
}
are all valid modifiers.
an array of the above
ExamplesA CSS modifier (as in BEM-like syntax) is added to each day cell when a day matches a modifier. You set the day modifiers with the selectedDay, disabledDays or modifiers props. Examples:To add a .DayPicker-Day--selected CSS class to the February, 12th 2017 cell:


To add a .DayPicker-Day--disabled to the 4th and 7th of February 2017


To set .DayPicker-Day--past to the past days:


You can pass more day modifiers using the modifiers prop: day.getDay() === 0, 

    firstOfMonth: day => day.getDate() === 1,
  }}
/>
selected and disabled modifiersUnder the hood, the selectedDays and disabledDays props act as shortcut for the selected and a disabled modifiers. The following renders the same calendar:
function sundays(day) {
    return day.getDay() === 0;
  }
function isFirstOfMonth(day) {
  return day.getDate() === 1;
}




Accessing modifiers from event handlersModifiers are passed as argument to the event handlers:function handleDayClick(day, modifiers) {
  if (modifiers.sundays) {
    console.log('Sunday has been clicked')
  }
}

function handleDayMouseEnter(day, { isFirstOfMonth, disabled }) {
  if (isFirstOfMonth) {
    console.log('The first day of month received mouse enter')
  }
  if (disabled) {
    console.log('This day is disabled')
  }
}


Use DateUtils to create modifiersreact-day-picker includes DateUtils, a small function library useful to simplify the creation of advanced modifiers.

